import React, { useState, useEffect } from "react";
import { useNavigate } from 'react-router-dom';
export default function Table(props) {
    const [titles, setTitles] = useState([])
    const [jobsDetails, setJobsDetails] = useState([])

    useEffect(() => {
        const fetchData = async () => {
            setJobsDetails(await props.jobsDetails);

            let titlesArray = [];
            for (const key in props.jobsDetails[0]) {
                titlesArray.push(key);
            }
            setTitles(titlesArray);
        };

        fetchData();
    }, [props.jobsDetails]);

    return (<div >
        <h1>sssss</h1>
        <table border="1px">
            <thead>
                <tr>
                   

                    {
                        jobsDetails ? titles.map((title) =>
                        (
                            < th key={title}>{title}</th>
                        )) :
                            < th ></th>

                    }

                </tr>
            </thead>
            {jobsDetails ? jobsDetails.map((jobDetail, i) =>
            (<tr key={jobDetail}>
                {titles.map((title) => (


                    <td >{jobDetail[title]}</td>


                ))}
            </tr>
            )
            ) : <tr></tr>}



        </table>
    </div >);
}
